import React from 'react';
import { AppBar, Toolbar, Typography } from "@mui/material"

function Header() {
    return (
        <div>
            <AppBar>
                <Toolbar>
                    <Typography variant='h3'>Booking</Typography>
                </Toolbar>
            </AppBar>
        </div>
    )
}

export default Header
